import { CategorySwiper } from 'components/Elements';
import { Wrapper } from './SearchResult.style';
import { useQuery } from 'react-query';
import { getWorkedAtByTimestamp } from 'utils/workedAt';

export const SearchResult = () => {
  const { data } = useQuery(['sort']);

  if (data?.standard === '최신순') {
    searchResults.aroundAd.contents = searchResults.aroundAd.contents.sort(
      (a, b) => {
        return b.postedAt - a.postedAt;
      }
    );
  } else {
    searchResults.aroundAd.contents = searchResults.aroundAd.contents.sort(
      (a, b) => {
        return b.accuracy - a.accuracy;
      }
    );
  }
  getWorkedAtByTimestamp(searchResults.aroundAd.contents[0].postedAt);

  return (
    <Wrapper>
      <CategorySwiper
        type="search"
        items={searchResults}
        isContentScrollY={true}
      ></CategorySwiper>
    </Wrapper>
  );
};

